import React, { useEffect, useRef, useState } from 'react';
import axios from "axios";
import { useNavigate } from 'react-router-dom';
function Bsolo1r({data}) {
    const navigate=useNavigate();
    const cr = () => {
        navigate("/result");
      };     
  return (
    <div className="sr">
      <div className="rc">
        <button id="rc" onClick={cr}>
          X
        </button>
      </div>
      <div className="pd">
        <div className="w">WINNER : 100</div>
        <div className="r">RUNNER : 50</div>
        <div className="k">KILL : 10</div>
      </div>
      <table>
        <tr>
            
          <th>POSITION</th>
          <th>PLAYER NAME</th>
          <th>KILLS</th>
          <th>CASH</th>
        </tr>
            
           {
            data.map((i)=>{
                <tr>
                <td>{i.position}</td>
                <td>{i.gamename}</td>
                <td>{i.kills}</td>
                <td>{i.kills*5}</td>
                </tr>
            })
           }
                    
                
                
                
            
      </table>
    </div>
  )
}
export default Bsolo1r
